var array = user.items
        array.indexOfObject = function (property, value) {
            for (let i = 0, len = this.length; i &lt; len; i++) {
              if (this[i][property] === value) return i;
            }
            return -1;
          }
        let indexofarray = `items.${array.indexOfObject(&quot;item&quot;,`${item.name}`)}.quantity`
        User.findOneAndUpdate({username:&quot;username&quot;},
            {
               $set:{
                indexofarray: array.item.quantity++
               }
            }).then(err =&gt; {
                console.log(err)
            })
</code></pre>
<p>i want to increase the quantity of the given item in the array which is straight forward. But i dont know where the item is going to be in the array so I have to get it using a function. But i cant throw that in there because it doesn't take variable's or <code>item.${array.indexOfObject(&quot;item&quot;,</code>${item.name}<code>)}.quantity</code>. Is there a way to do this? Or a different way to achieve this result?</p>
<p>any help towards the right direction helps!</p>

