Push an object into a nested array in MongoDB<p>I've got a head-scratcher here that I'd like to share with you all.</p>
<p>So here's the model:</p>
<pre><code>    _id: ObjectId()
    name: String,
    columns: [
      {
        name: String,
        _id: ObjectId()
        tasks: [
          {
            title: String,
            description: String,
            status: String,
            _id: ObjectId()
            subtasks: [
              {
                title: String,
                isCompleted: Boolean,
              },
            ],
          },
        ],
      },
    ],
  });
</code></pre>
<p>and the query:</p>
<pre><code>exports.createSubtask = (req, res) =&gt; {
  if (!req.body) {
    res.status(400).send({ message: &quot;Task name can not be empty!&quot; });
    return;
  }

  const board = req.params.board;
  const column = req.params.column;
  const task = req.params.task;

  Board.findOneAndUpdate(
    {
      _id: board,
      &quot;columns._id&quot;: column,
      &quot;columns.tasks._id&quot;: task,
    },
    {
      $push: {
        &quot;columns.$.tasks.$.subtasks&quot;: req.body,
      },
    }
  )
    .then((data) =&gt; {
      if (!data) {
        res.status(404).send({
          message: `Cannot update Task with id=${task}. Maybe task was not found!`,
        });
      } else res.send({ message: &quot;Task was updated successfully.&quot; });
    })
    .catch((err) =&gt; {
      res.status(500).send({
        message: &quot;Error updating Task with id=&quot; + task,
      });
    });
};
</code></pre>
<p>I'm trying to push an object into the <em>subtasks</em> array with <em>$push</em>, but Postman is throwing an error.</p>
<p>Any ideas as to what I'm doing wrong?  Appreciate the help.</p>
<ul>
<li>Golden Ratio</li>
</ul>
<p>However, I was able to successfully push an object into the <em>tasks</em> array with the following query:</p>
<pre><code>exports.createTask = (req, res) =&gt; {
  if (!req.body) {
    res.status(400).send({ message: &quot;Task name can not be empty!&quot; });
    return;
  }

  const board = req.params.board;
  const column = req.params.column;

  Board.findOneAndUpdate(
    {
      _id: board,
      &quot;columns._id&quot;: column,
    },
    {
      $push: {
        &quot;columns.$.tasks&quot;: req.body,
      },
    }
  )
    .then((data) =&gt; {
      if (!data) {
        res.status(404).send({
          message: `Cannot update Column with id=${column}. Maybe column was not found!`,
        });
      } else res.send({ message: &quot;Column was updated successfully.&quot; });
    })
    .catch((err) =&gt; {
      res.status(500).send({
        message: &quot;Error updating Column with id=&quot; + column,
      });
    });
};
</code></pre>

