<pre><code>[
  {
    &quot;_id&quot;: &quot;1&quot;,
    &quot;ML_PRIORITY&quot; : &quot;HIGH&quot;,
    &quot;STATUS&quot; : &quot;True&quot;
  },
  {
    &quot;_id&quot;: &quot;2&quot;,
    &quot;ML_PRIORITY&quot; : &quot;HIGH&quot;,
    &quot;STATUS&quot; : &quot;&quot;
  },
  {
    &quot;_id&quot;: &quot;3&quot;,
    &quot;ML_PRIORITY&quot; : &quot;HIGH&quot;,
    &quot;STATUS&quot; : &quot;False&quot;
  },
  {
    &quot;_id&quot;: &quot;4&quot;,
    &quot;ML_PRIORITY&quot; : &quot;MEDIUM&quot;,
    &quot;STATUS&quot; : &quot;&quot;
  },
  {
    &quot;_id&quot;: &quot;5&quot;,
    &quot;ML_PRIORITY&quot; : &quot;Low&quot;,
    &quot;STATUS&quot; : &quot;&quot;
  }
]
</code></pre>
<p>I was able to determine the count of STATUS for each ML_PRIORITY using below aggregation pipeline
but I am not sure how can I custom sort the ML_PRIORITY as $sort has only two option (1 and -1)</p>
<pre><code>db.collection.aggregate([
    {
        '$group': {
            '_id': '$ML_PRIORITY', 
            'QUALITYCHECKDONE': {
                '$sum': {
                    '$cond': [
                        {
                            '$eq': [
                                '$STATUS', 'TRUE'
                            ]
                        }, 1, 0
                    ]
                }
            }, 
            'QUALITYCHECKNOTDONE': {
                '$sum': {
                    '$cond': [
                        {
                            '$eq': [
                                '$STATUS', ''
                            ]
                        }, 1, 0
                    ]
                }
            }, 
            'QUALITYCHECKNOTREQ': {
                '$sum': {
                    '$cond': [
                        {
                            '$eq': [
                                '$STATUS', 'FALSE'
                            ]
                        }, 1, 0
                    ]
                }
            }
        }
    }, {
        '$project': {
            '_id': 0, 
            'ML_PRIORITY': '$_id', 
            'QUALITYCHECKDONE': 1, 
            'QUALITYCHECKNOTDONE': 1, 
            'QUALITYCHECKNOTREQ': 1
        }
    }
])
</code></pre>
